import React, { useState } from "react";
import arrow from "./arrow.svg";

export default function Drawer({ isOpen }) {
  const disp = isOpen === true ? "none" : "block";
  return (
    <div
      className="drawer"
      style={{
        display: disp,
        zIndex: "3",
        position: "absolute",
      }}
    >
      <div
        style={{
          width: "450px",
          height: "640px",
        }}
      >
        <div
          style={{
            display: "flex",
            backgroundColor: "green",
            padding: "10px 10px 30px 10px",
          }}
        >
          <img
            src={arrow}
            style={{
              height: "30px",
              width: "30px",
              margin: "5px",
            }}
          />
          <h3 style={{ color: "white" }}>Profile</h3>
        </div>
        <div></div>
      </div>
    </div>
  );
}
